import React from 'react'

import TextField from '@material-ui/core/TextField';
import { makeStyles } from '@material-ui/core/styles';


const useStyles = makeStyles((theme) => ({
    root: {
      '& .MuiTextField-root': {
        margin: theme.spacing(1),
        width: '25ch',
      },
    },
  }));
function Login() {
    const classes = useStyles();

    return (
        <div className="container">
          <h1>sign in </h1>
            <div className="row">
            <TextField style={{minWidth:"20%"}} className="col" required id="standard-required" label="Username" defaultValue="" />
            </div>
            <div className="row">
            <TextField style={{minWidth:"20%"}}  className="col" required id="standard-password-input" label="Password" type="password" autoComplete="current-password" />
            </div>
            
            
            
        </div>
    )
}

export default Login
